function Welcome() {
    return(
        <section className="welcome">
            <div className="container">
              <div className="welcome-inner">
                <div className="welcome-title">
                  <h1>Ansagang Movies</h1>
                </div>
              </div>
            </div>
          </section>
    )
}

export default Welcome;
